export function insertMovie(data) {
    let movie = getAllMovies();
    data['id'] = generateMovie()
    movie.push(data)
    localStorage.setItem(KEYS.movies, JSON.stringify(movie))
}

export function updateMovie(data) {
    let movie = getAllMovies();
    let recordIndex = movie.findIndex(x => x.id == data.id);
    movie[recordIndex] = { ...data }
    localStorage.setItem(KEYS.movie, JSON.stringify(movie));
}

export function generateMovieId() {
    if (localStorage.getItem(KEYS.movieId) == null)
        localStorage.setItem(KEYS.movieId, '0')
    var id = parseInt(localStorage.getItem(KEYS.movieId))
    localStorage.setItem(KEYS.movieId, (++id).toString())
    return id;
}

export function getAllMovies() {
    if (localStorage.getItem(KEYS.movie) == null)
        localStorage.setItem(KEYS.movie, JSON.stringify([]))
    let movie = JSON.parse(localStorage.getItem(KEYS.movie));
    //map departmentID to department title
    let departments = getDepartmentCollection();
    return movie.map(x => ({
        ...x,
        movie: movie[x.departmentId - 1].movie
    }))
}